package com.example.prescription_module.domain;import jakarta.persistence.*;import java.sql.Timestamp;import java.util.HashSet;import java.util.Set;import lombok.Getter;import lombok.Setter;@Entity@Getter@Setterpublic class PrescriptionHistory {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long id;    private Long idPatient;    private Long idDoctor;    private Timestamp timestamp;    @ManyToMany    private Set<Medication> medications = new HashSet<>();    public PrescriptionHistory() {    }    public PrescriptionHistory(Long idPatient, Long idDoctor, Timestamp timestamp, Set<Medication> medications) {        this.idPatient = idPatient;        this.idDoctor = idDoctor;        this.timestamp = timestamp;        this.medications = medications;    }}